Well that's a bit odd, isn't it?
How is that a gift?
üïê
Quite simply, that we will one day die - gives our lives purpose.
It makes us do things, because we might not be able to do them later.
We treasure moments that are precious because we won't always be able to.
It gives time meaning, for without mortality, the slippage of time means nothing.
It provides meaning to every moment.
üïê
Further, it makes us create, so we have something to leave behind.
Something to say "I was here".
A little slice of immortality.
If we all lived forever, why do anything? What would it matter?
Can you imagine the procrastination?
Can you imagine the divorce rate? üòÇ
üïê
By changing your perception, even the biggest things can change

